export function Contact() {
    return (
        <div>
            <p><a href="https://www.lowes.com/">Main Wesbite</a></p>
            <p><a href="https://twitter.com/lowes">Twitter</a></p>
            <p><a href="https://www.youtube.com/channel/UCqd2hbtE2N9fb0D2nTrLT1w">YouTube</a></p>
            <iframe width="560" height="315" src="https://www.youtube.com/embed/FFCKp6MnCrI" 
                title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; 
                clipboard-write; encrypted-media; gyroscope; picture-in-picture" 
                allowfullscreen></iframe>
        </div>
    );
}
